import React from "react";
import styled from "styled-components";

const HomeWrapper = styled.div`
  autoplay: true;
`;

export const Home: React.FC = () => {
  return (
    <HomeWrapper>
      <video src="/video/mainVideo" />
    </HomeWrapper>
  );
};
